        def calculate_tdee():
            result = ''
            if self.lineEdit_age_tdee.text() == '' or self.lineEdit_height_tdee.text() == '':
                result = 'TDEE: 0'
            else:
                gender = ''
                if self.radioButton_male_tdee.isChecked():
                    gender = 'm'
                elif self.radioButton_female_tdee.isChecked():
                    gender = 'f'
                weight = float(self.lineEdit_weight_tdee.text())
                height = float(self.lineEdit_height_tdee.text())
                age = int(self.lineEdit_age_tdee.text())
                activity_index = self.comboBox_activity_tdee.currentIndex()
                activity_index_text = self.comboBox_activity_tdee.itemText(activity_index)

                tdee = bmr(gender, weight, height, age, activity_index_text)
                result = f"TDEE: {tdee:.0f}"

            self.label_tdee.setText(str(result))

        def calculate_bodyfat():
            result = ''
            if self.lineEdit_height_bf.text() == '' or self.lineEdit_neck_bf.text() == '':
                result = 'BF: 0'
            else:
                gender = ''
                if self.radioButton_male_bf.isChecked():
                    gender = 'm'
                elif self.radioButton_female_bf.isChecked():
                    gender = 'f'

                if self.lineEdit_hip_bf.text() == '':
                    self.lineEdit_hip_bf.setText('0')

                height = float(self.lineEdit_height_bf.text())
                waist = float(self.lineEdit_waist_bf.text())
                neck = float(self.lineEdit_neck_bf.text())
                hip = float(self.lineEdit_hip_bf.text())

                bf = bf_percentage(gender, height, waist, neck, hip)
                result = f"BF: {bf:.0f}%"  # BF text cut out by padding or something

            self.label_bf.setText(str(result))

        def calculate_potential():
            result = ''
            if self.lineEdit_bodyfat_pot.text() == '':
                self.lineEdit_bodyfat_pot.setText('12')
            if self.lineEdit_height_pot.text() == '' or self.lineEdit_wrist_pot.text() == '':
                result = 'Weight: 0'
            else:
                if self.lineEdit_bodyfat_pot.text() == '':
                    self.lineEdit_bodyfat_pot.setText('12')
                height = float(self.lineEdit_height_pot.text())
                wrist = float(self.lineEdit_wrist_pot.text())
                ankle = float(self.lineEdit_ankle_pot.text())
                bodyfat = float(self.lineEdit_bodyfat_pot.text())

                potential = butts_model(height, wrist, ankle, bodyfat)
                result = f"Weight: {potential:.0f}"  # BF text cut out by padding or something

            self.label_weight_pot.setText(str(result))

        def inch_cm():
            self.lineEdit_centimeter_un.setText('')
            if self.lineEdit_inch_un.text() != '':
                val = float(self.lineEdit_inch_un.text()) * 2.54
                rounded = f"{val:.2f}"
                self.lineEdit_centimeter_un.setText(str(rounded))
            elif self.lineEdit_inch_un.text() == '':
                self.lineEdit_centimeter_un.setText('')

        def cm_inch():
            self.lineEdit_inch_un.setText('')
            if self.lineEdit_centimeter_un.text() != '':
                val = float(self.lineEdit_centimeter_un.text()) / 2.54
                rounded = f"{val:.2f}"
                self.lineEdit_inch_un.setText(str(rounded))
            elif self.lineEdit_centimeter_un.text() == '':
                self.lineEdit_inch_un.setText('')

        def lbs_kg():
            self.lineEdit_kilo_un.setText('')
